import React from 'react';

const Navbar = () => {
  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <nav className="fixed top-0 w-full bg-white shadow-md z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          <div className="flex items-center">
            <span 
              onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}
              className="text-xl font-bold text-gray-800 cursor-pointer select-none"
            >
              MOE
            </span>
          </div>

          <div className="flex items-center space-x-8">
            <button
              onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}
              className="text-gray-700 hover:text-blue-600 px-3 py-2 text-sm font-medium select-none"
            >
              Home
            </button>

            <button
              onClick={() => scrollToSection('residential')}
              className="text-gray-700 hover:text-blue-600 px-3 py-2 text-sm font-medium select-none"
            >
              Residential
            </button>

            <button
              onClick={() => scrollToSection('commercial')}
              className="text-gray-700 hover:text-blue-600 px-3 py-2 text-sm font-medium select-none"
            >
              Commercial
            </button>

            <button
              onClick={() => scrollToSection('school')}
              className="text-gray-700 hover:text-blue-600 px-3 py-2 text-sm font-medium select-none"
            >
              School
            </button>

            <button
              onClick={() => scrollToSection('interior')}
              className="text-gray-700 hover:text-blue-600 px-3 py-2 text-sm font-medium select-none"
            >
              Interior
            </button>

            <button
              onClick={() => scrollToSection('about')}
              className="text-gray-700 hover:text-blue-600 px-3 py-2 text-sm font-medium select-none"
            >
              About
            </button>

            <button
              onClick={() => scrollToSection('contact')}
              className="text-gray-700 hover:text-blue-600 px-3 py-2 text-sm font-medium select-none"
            >
              Contact
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
